import { ISocialLoginAccount } from "../../../models/ISocialLoginAccount";

const SocialLoginAccountPTBR: ISocialLoginAccount = {
    title: "Você já possuí uma conta!",
    subTitle: "Para acessar a sua conta reutilize o seu social login ou crie uma nova conta utilizando o e-mail",
    linkChangeEmail: "Alterar e-mail",
    btn: "Criar uma nova conta"
};
export default SocialLoginAccountPTBR;
